    such.    3.  Transfers made to the Non Federal account were for cash flow purposes
    and were not used to finace Federal activity.    4.  Expenses on Line 30(b) for
    GOTV did not not promote, support, attack or oppose a federal candidate.    5.
    \ It is the Committee's understanding that only the IE triggering the $1,000 reporting
    threshold for 24 hour reporting gets reported and that is what was done by the
    Committee.     6.  Election designations have now been added to all expenditures
    on Schedule E.    7.  Payments reported on Schedule E after the election were
    not new IEs, but rather additional payments on previous IEs.  The vendor mis-invoiced
